import React from "react";

const Navbar = () => {
  return (
    <div className="navbar navbar-dark">
      <div className="container">
        <div className="navbar-header">Mas Sahal</div>
        <ul className="nav navbar-nav">
          <li>
            <a href="">Home</a>
          </li>
        </ul>
      </div>
    </div>
  );
};
export default Navbar;
